    "content_ru": "",
    "content_pt": "",
    "content_zh": "Fecshop 全称为Fancy ECommerce Shop，是基于php Yii2框架之上开发的一款优秀的开源电商系统，遵循OSL3.0开源协议，Fecshop支持多语言，多货币，架构上支持pc，手机web，手机app，和erp对接等入口，您可以免费快速的定制和部署属于您的电商系统。预计到2017-05月份 ，完成appfront（pc前端web），appadmin（后台）命令控制台 这几个入口 ，目前appfront和appadmin功能已经打通，但是，系统的代码bug需要排查，代码需要优化，不建议应用到生产环境，如果您一定要在生产环境中用，可以联系我，我会随时技术支持,Terry从事外贸电商6年来， 用了不少开源电商系统，譬如magento，发现开源框架都有一定 的诟病，在并发方面差，后期扩展，业务发展后期重构难， 尤其是现在的移动端的发展，多入口的电商模式占据主流， 性能方面的要求越来越高，Fecshop基于Yii2的高效框架，在此基础上进一步封装，加入了service层和block层，数据库采用了nosql和mysql结合的方式， 关系型表放到mysql中，譬如优惠券，购物车，订单等， 非关系型数据表（非关系型代表不会出现多表强事务类型操作） 放到mongodb中，缓存用redis，搜索目前用的是mongodb的FullTextSearch功能，支持一些主流语言的分词与搜索，不过目前中文搜索不支持分词，后期会扩展ElasticSearch来进行搜索（ElasticSearch有中文插件，安装后支持中文分词）。总之，Fecshop目前的定位是为了让程序员们有一个方便学习，扩展，开发的电商框架系统，如果您发现有哪些代码结构可以优化，调整，或者您有更加合理的建议，可以发送到邮箱：2358269014@qq.com。<p><span id=\"result_box\" lang=\"en\"><span title=\"： 2358269014@qq.com。\"><img src=\"//img.fancyecommerce.com/media/upload/p/su/psu.jpg\" alt=\"\" /><br /></span></span></p>"
